sys_variable_value.value:
(function execute(inputs, outputs) {

var payload = {}

if (inputs.from) { payload.from = inputs.from }
if (inputs.to) { payload.to = inputs.to }
if (inputs.amount) { payload.amount = inputs.amount }
if (inputs.sign_with) { payload.sign = inputs.sign_with }

outputs.cmd = JSON.stringify(payload)

})(inputs, outputs);

